@pytest.mark.parametrize("elev_angle, expected_result", [(0, 1979), (10, 1160), (90, 300), (-45, 9435), (180, 1979)])
def test_slant_dist_calc(elev_angle, expected_result):
    """
    Test name:
    Test function: slant_dist_calc()
    description:
    """
    assert abs(slant_dist_calc(elev_angle) - expected_result) <= 1


@pytest.mark.parametrize("power, gain, expected_result", [(1, 1, 0), (2, 1, 3.01), (1, 10, 9), (1, -10, -11)])
def test_EIRP_calc(power, gain, expected_result):
    """
    Test name:
    Test function: EIRP_calc()
    description:
    """
    assert abs(EIRP_calc(power, gain) - expected_result) <= 0.001


