@pytest.mark.parametrize("max_elev, antenna, rotation_axes, expected_result", [(6, isoflux, 2, [3.9, 5.0, 3.9]),
                                                                               (7, isoflux, 0, [1.3, 1.7, 2.1, 1.7, 1.3]),
                                                                               (6, omnidirectional, 0, [0.8, 1, 0.8])])
def test_data_vs_elev(max_elev, antenna, rotation_axes, expected_result):
    """
    Test name:
    Test function: data_vs_elev()
    description:
    """
    data_vs_elevation_list = data_vs_elev(max_elev, antenna, rotation_axes)
    for i, value in enumerate(data_vs_elevation_list):
        assert abs(value - expected_result[i]) <= 0.1


